            <img src={uvmetalFace} width="205" height="205" alt="neo-burner" className=""  />
            <p className="lead">Paper Wallet Event Manager</p>
            <p className="lead mx-auto">
            <Button onClick={this.letsBurn} color="warning" >Let's Burn!</Button>
              <p/>
            </p>
          </div>
        </Jumbotron>
        </React.Fragment>
    );
  }
}
export default Home
